import ReactDOM from 'react-dom';
import React, { Component } from 'react';
import './index.css';

class Statement extends Component{
	constructor(props){
		super(props);
		this.state = {date: new Date()};
	}

	render(){
		return (
		  <div>
		  <th> {props.currentVersion}</th>
		  <th> props.documentType</th>
		  <th>props.previousVersion</th>
		  <th>props.Comparison</th>
		  <th>{this.state.date.toLocaleTimeString()}</th>
		  </div>
			);
		}
}

class StatementTable extends Component{
	constructor(props){
		super(props);
		// this.state = {statementList: [new Statement(), new Statement()]}
		// this.state = {statementList: ["john", "Jeff"]}
		// this.state = {statements: new Statement()}
		this.state = {statements: []}
	}


  componentDidMount() {
  	 const params = {cusip:'cusip', reportingDate:'reportingDate', statementType:'statementType', reviewStep:'reviewStep'};
  	 fetch('http://localhost:9000/getStatements?cusip=${encodeURIComponent(params.cusip)}&reportingDate=${encodeURIComponent(params.reportingDate)}&statementType=${encodeURIComponent(params.statementType)}&reviewStep=${encodeURIComponent(params.reviewStep)}')
  	 .then(res => res.json())
  	 .then((data) => {
  	 	this.setState({ statements: data})
  	 })
  	 .catch(console.log)
  }

	render() {
		return (
			<table>
			<tr>
			<Statement statements={this.state.statements}/>
			</tr>
			</table>
			);
	}

}


ReactDOM.render(<StatementTable />, document.getElementById('root'));
